    9307u201948u201dW near Swan Lake NWR, 23.5 miles southeast of Chillicothe, MO, in
    Charlton County. Gage is mounted 9 feet off the ground on a tree in the woods downstream
    of the bridge on the left bank. DRAINAGE AREA: 414 square miles SURFACE WATER RECORDS
    PERIOD OF RECORD: June 24, 2010 to present. GAGE SITE: Sutron Monitor 1 in metal
    gage housing in communication with a KPSI submersible pressure transducer mounted
    on a fencepost in the streambed near old railroad bridge. Instruments are powered
    by a solar panel run to a battery inside the gage housing. Stage data are collected
    at 15 minute intervals. Datum of gage is in North AmericanVertical Datum of 1988.
